create table dungeons
(
    Id                 int auto_increment
        primary key,
    Name               varchar(255) null,
    NameId             int unsigned null,
    MapsIdsCSV         mediumtext   null,
    OptimalPlayerLevel int          null,
    FirstRoom          int          null,
    EntranceMapId      int          null,
    ExitMapId          int          null
)
    engine = MyISAM
    charset = utf8;

